import React from 'react';
import { BrowserRouter as Switch, Route } from "react-router-dom";

function Content(){
    return(
    <Switch>
        <Route exact path="/iphone" component={Iphone} />
        <Route path="/samsung" component={Samsung} />
    </Switch>
        )
}

function Iphone() {
    return <h2>Iphone</h2>;
  }
  function Samsung() {
    return <h3>Samsung</h3>;
  } 
export default Content
